import React from "react";
import AppLayout from "../components/AppLayout";
import { Provider } from "react-redux";

const Home = () => {
  return (
    <Provider>
      <AppLayout>
        <div>Hello, Next!</div>
      </AppLayout>
    </Provider>
  );
};

export default Home;
